import React from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import {
    Container,
    Paper,
    Typography,
    Box,
    Grid,
    Button,
    LinearProgress,
    Chip
} from '@mui/material';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';

function PokemonDisplay({ getTypeColor }) {
    const { pokemonName } = useParams();
    const navigate = useNavigate();
    const pokemon = JSON.parse(localStorage.getItem('selectedPokemon'));

    const StatBar = ({ label, value, maxValue = 255 }) => (
        <Box sx={{ width: '100%', mb: 2 }}>
            <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 0.5 }}>
                <Typography variant="body2" color="text.secondary">
                    {label}
                </Typography>
                <Typography variant="body2" color="text.primary" fontWeight="bold">
                    {value}
                </Typography>
            </Box>
            <LinearProgress
                variant="determinate"
                value={(value / maxValue) * 100}
                sx={{
                    height: 10,
                    borderRadius: 5,
                    backgroundColor: 'rgba(0,0,0,0.1)',
                    '& .MuiLinearProgress-bar': {
                        backgroundColor: '#2F6690'
                    }
                }}
            />
        </Box>
    );

    if (!pokemon) {
        return (
            <Container maxWidth="md" sx={{ py: 4 }}>
                <Typography variant="h5" align="center">
                    Pokemon not found
                </Typography>
                <Box sx={{ display: 'flex', justifyContent: 'center', mt: 2 }}>
                    <Button
                        variant="contained"
                        startIcon={<ArrowBackIcon />}
                        onClick={() => navigate('/')}
                    >
                        Back to List
                    </Button>
                </Box>
            </Container>
        );
    }

    return (
        <Container maxWidth="md" sx={{ py: 4 }}>
            <Button
                variant="outlined"
                startIcon={<ArrowBackIcon />}
                onClick={() => navigate('/')}
                sx={{ mb: 3 }}
            >
                Back to List
            </Button>

            <Paper elevation={3} sx={{ p: 4, borderRadius: 4 }}>
                <Typography
                    variant="h3"
                    component="h1"
                    gutterBottom
                    align="center"
                    sx={{
                        fontWeight: 'bold',
                        color: '#2F6690',
                        mb: 4
                    }}
                >
                    {pokemon.Name} {pokemon.Name2 && `(${pokemon.Name2})`}
                </Typography>

                <Box sx={{ display: 'flex', justifyContent: 'center', gap: 2, mb: 4 }}>
                    <Chip
                        label={pokemon.Primary_Type}
                        sx={{
                            bgcolor: getTypeColor(pokemon.Primary_Type),
                            color: 'white',
                            fontSize: '1rem',
                            py: 2,
                            px: 1
                        }}
                    />
                    {pokemon.Secondary_type && (
                        <Chip
                            label={pokemon.Secondary_type}
                            sx={{
                                bgcolor: getTypeColor(pokemon.Secondary_type),
                                color: 'white',
                                fontSize: '1rem',
                                py: 2,
                                px: 1
                            }}
                        />
                    )}
                </Box>

                <Grid container spacing={4}>
                    <Grid item xs={12} md={6}>
                        <Paper elevation={2} sx={{ p: 3, borderRadius: 3, height: '100%' }}>
                            <Typography variant="h6" gutterBottom sx={{ color: '#2F6690' }}>
                                Base Stats
                            </Typography>
                            <StatBar label="HP" value={pokemon.HP} />
                            <StatBar label="Attack" value={pokemon.Attack} />
                            <StatBar label="Defense" value={pokemon.Defense} />
                            <StatBar label="Speed" value={pokemon.Speed} />
                            <StatBar label="Sp. Attack" value={pokemon.Sp_Attack} />
                            <StatBar label="Sp. Defense" value={pokemon.Sp_Defense} />
                        </Paper>
                    </Grid>
                    <Grid item xs={12} md={6}>
                        <Paper elevation={2} sx={{ p: 3, borderRadius: 3, height: '100%' }}>
                            <Typography variant="h6" gutterBottom sx={{ color: '#2F6690' }}>
                                Total Stats
                            </Typography>
                            <Box
                                sx={{
                                    display: 'flex',
                                    alignItems: 'center',
                                    justifyContent: 'center',
                                    height: '80%'
                                }}
                            >
                                <Typography
                                    variant="h2"
                                    sx={{
                                        fontWeight: 'bold',
                                        color: '#2F6690'
                                    }}
                                >
                                    {pokemon.Total}
                                </Typography>
                            </Box>
                        </Paper>
                    </Grid>
                </Grid>
            </Paper>
        </Container>
    );
}

export default PokemonDisplay;
